INSERT INTO `dokumen_dpm` (`id_dokumen_dpm`, `id_organisasi`, `foto`, `nim`, `nama`, `email`, `visi`, `misi`, `program`, `surat_mahasiswaaktif`, `surat_hasilstudi`, `surat_mentoring`, `surat_cutiorganisasi`, `surat_kepanitiaan1`, `surat_kepanitiaan2`, `surat_kepanitiaan3`, `surat_kepanitiaan4`, `surat_kepanitiaan5`, `visi_misi_program`, `surat_dukungan`, `sk`) VALUES
(2, 1, 'foto.jpg', '0110218061', 'Abidun Alim', 'abidunalim27@gmail.com', 'Menjadikan Dewan  Perwakilan Mahasiswa STT NF sebagai organisasi yang Harmonis, Transparan,  Responsif', '<ol> <li>Membangun harmonisasi kekeluargaan dan kesolidan internal DPM IM STT-NF</li> <li>Menjalankan aksi cepat tanggap terhadap segala aspek yang berkaitan dengan mahasiswa STT NF</li> <li>Meningkatkan koordinasi antar LFK di STT NF</li> <li>Memperkuat landasan hukum IM STT NF</li> </ol>', '<ol> <li><b>Keluarga DPM</b><br>Merupakan wadah untuk internal DPM itu sendiri sebagai tempat memperkuat tali persaudaraan antar sesama anggota DPM IM STT-NF.</li> \r\n<li><b>DPM untuk semua</b><br>Merupakan  sarana  untuk mempublikasikan wacana kegiatan  dan Press Release, serta informasi terkait yang dianggap perlu untuk kebutuhan mahasiswa. Kegiatan ini fokus pada maksimalisasi informasi dengan menggunakan media cetak, media elektronik, serta media sosial lainnya.</li> </ol>', '002 - Abidun Alim.pdf', 'Transkrip Abidun Alim.pdf', 'surat keaktifan mentoring.pdf', '053_Surat Cuti Abidun.pdf', 'Sertifikat Pemira 2020.pdf', '', '', '', '', 'Grand Desaign DPM-Abidun Alim.pdf', 'Surat Dukungan Mahasiswa.docx', '017 A.01 - Surat Keputusan Abidun.pdf'),
(3, 1, 'foto.jpg', '0110118040', 'Miftahussa\'adah Putri Siddiq', 'miftaps.12@gmail.com', 'TERWUJUDNYA DEWAN PERWAKILAN MAHASISWA STT NF SEBAGAI ORGANISASI YANG ADAPTIF DAN MEMILIKI SIKAP ASERTIF, SERTA MAMPU MENJADI RUANG KOMUNIKATIF BAGI LFK STT NF', '<ol> <li>MEMBANGUN LINKUNGAN INTERNAL YANG SOLID DAN APRESIATIF GUNA MENINGKATKAN VALUE DARI SUMBER DAYA ORGANISASI</li> <li>MENGHADIRKAN KELUGASAN SEKALIGUS KETEGASAN DALAM MENJALANKAN FUNGSI ORGANISASI</li> <li>MENYEDIAKAN WADAH KEAKRABAN SEBAGAI BENTUK KOLABORASI DARI LFK STT NF</li> </ol>', '<ol> <li><b>INSIGHT (Intelligent , solid, sight)</b><br>Program INSIGHT ini bertujuan sebagai sosialisasi dan pencerdasan kepada anggota internal DPM IM STT NF dalam memahami AD/ART serta produk hukum lainnya, dan juga sebagai sarana mempererat kesolidan antar anggota internal DPM IM STT NF. Dimana bentuk kegiatannya adalah melakukan review tuntas dari AD/ART dan produk hukum lainnya oleh seluruh anggota DPM IM STT NF.</li> \r\n<li><b>KUNJUNG DPM</b><br>Program Kunjung DPM ini memiliki tujuan kegiatan untuk meningkatkan komunikasi, dan koordinasi, serta sharing knowledge dengan aktor-aktor di luar DPM. Dimana ada 3 sub program dalam Kunjung DPM ini :\r\n<ul>\r\n<li>Kunjung DPM bersama pengurus inti dari LFK STT NF yang lain, baik itu BEM maupun Senada minimal ketua/perwakilannya. Tujuannya  mengetahui update kabar terbaru yang sedang dialami oleh masing-masing LFK STT NF.</li>\r\n<li>Kunjung DPM bersama kemahasiswaan, dengan tujuan untuk mengetahui update kabar terbaru dari kemahasiswaan mengenai agenda maupun perencanaan lain yang sedang disusun oleh kemahasiswaan terhadap civitas akademika STT NF.</li>\r\n<liKunjung DPM bersama perwakilan DPM dari Perguruan Tinggi lain, dengan tujuan untuk saling berbagi wawasan dan pengetahuan mengenai kondisi maupun strategi yang dilakukan di internal DPM masing-masing kampus.<br><br>Dari ketiga sub program yang diajukan memiliki persamaan dalam bentuk kegiatannya, yakni berupa diskusi ringan.</li>\r\n</ul>\r\n</li> \r\n</ol>', 'Surat Keterangan Mahasiswa Aktif_Miftahussaâ€™adah Putri Siddiq.pdf', 'Transkrip_Miftahussa\'adah Putri Siddiq.pdf', 'Surat Ket. Aktif Mentoring_Miftahussa\'adah Putri Siddiq.pdf', 'Surat Cuti_Miftahussa\'adah Putri Siddiq.pdf', 'Sertif_ASTRO_Miftahussa\'adah Putri Siddiq.pdf', 'Sertif_PEMIRA_Miftahussa\'adah Putri Siddiq.pdf', 'Sertif_Diesnatalis_Miftahussa\'adah Putri Siddiq.pdf', 'Sertif_ORMIK_Miftahussa\'adah Putri Siddiq.pdf', '', 'GD_Miftahussa\'adah PS..pdf', 'Surat Dukungan Mahasiswa_Miftahussa\'adah Putri Siddiq.pdf', '018 A.01 - Surat Keputusan Miftahussaadah.pdf');
